import React from 'react';
import List from './components/list/List';

const App = () => {
  return (
    <div className="App">
      <List />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
  );
}

export default App;
